import React from 'react';
import {Form, Formik, Field} from "formik";

const OrderInfo = () => {
    const initialValues = {
        brand: 'DMC',
        shopAddress: 'Крещатик'
    }

    return (
        <Formik>
            <div>
                Бренд ниток:
                <Field as='select' name='brand' id='brand'>
                    <option value="DMC">DMC</option>
                    <option value="KIROVO">Kirovo</option>
                </Field>
            </div>
            <div>
                Адресс магазина
            </div>
        </Formik>
    );
};

export default OrderInfo;
